  return (
    <header className="bg-green-600 text-white py-4 px-8 flex items-center shadow-md">
      {/* Logo */}
      <div className="flex items-center">
        <span className="bg-white text-green-600 font-bold px-2 py-1 text-lg rounded-md">CONECTA</span>
      </div>
    </header>
  );
};

